window.bookSummaryJSON = "<p>Vlad Taltos is a mobster and assassin in the magical metropolis of Adrilankha. A member of the Great House of Jhereg (named for the tiny dragon-like creatures native to Dragaera), Taltos is given the largest contract of his career but the job is even more complicated than he expects.</p> <p>The first book in Stephen Brust's \"Vlad Taltos\" series, <i>Jhereg</i> has also been adapted into a graphic novel by Marvel Comics. Here, Bernard Setaro Clark brings the tale to life in a rousing performance.</p>"; 
